import {Grid,
        Text,
        GridItem} from "@chakra-ui/react";
import {extendTheme} from "@chakra-ui/react";

const theme=extendTheme({
    fonts:"Inter"
})

export const Navbar=()=>{
    return(
        <div>
            <Grid templateColumns="repeat(8, 1fr)" gap={1} bgColor="whitesmoke">
                <GridItem colSpan={2} h="20"  >
                    <Text theme={theme} fontSize="5xl" mx="7" my="2" fontWeight="extrabold">
                        Blog
                    </Text>
                    </GridItem>
                <GridItem colStart={6} colEnd={7} h="20"  >
                    <Text fontSize="xl" m="5" fontWeight="semiBold" color="gray.500">Register</Text>
                    </GridItem>
                <GridItem colStart={7} colEnd={8} h="20"  >
                    <Text fontSize="xl" m="5" fontWeight="semiBold" color="gray.500">Login</Text>
                    </GridItem>
            </Grid>
        </div>
    )
}
